namespace B2W\SkyHub\Contracts\Sales\Order\Shipment\Track;

/**
 * Interface Entity
 * @package B2W\SkyHub\Contracts\Sales\Order\Shipment\Track
 */
interface Entity
{
    /**
     * @return string
     */
    public function getCode();

    /**
     * @param $code
     * @return string
     */
    public function setCode($code);

    /**
     * @return string
     */
    public function getCarrier();

    /**
     * @param $carrier
     * @return string
     */
    public function setCarrier($carrier);

    /**
     * @return string
     */
    public function getMethod();

    /**
     * @param $method
     * @return string
     */
    public function setMethod($method);
}
